function generarPlanificacionSemanal() {
    const fecha_select = document.getElementById("fecha_select");
    let idPlanificación = fecha_select.options[fecha_select.selectedIndex].id;
    idPlanificación = idPlanificación.split("_")
    //console.log(idPlanificación[1])
    $.ajax({
        type: "get",
        url: "/actividad/cronograma/generar/",
        data: { 'planificacion': JSON.stringify(idPlanificación[1]), 'csrfmiddlewaretoken': '{{ csrf_token }}' },
        success: function (data) {
            if (data['result'] == "OK") {
                generarTablaPlanificacion(data)
                console.log("¡Registro de persona guardado exitosamente")
                //setTimeout("location.href='/actividad/listar'",10)
            } else {
                console.log("¡ Error en la transacción ")
            }
        }
    });

    
}

function guardarCronograma() {
    const fecha_select = document.getElementById("fecha_select");
    let idPlanificación = fecha_select.options[fecha_select.selectedIndex].id;
    idPlanificación = idPlanificación.split("_")
    //console.log(idPlanificación[1])
    let notas = document.getElementById("notasCronograma").value;
    datos = {
        'notas': notas,
        'idplanificacion':idPlanificación[1],
    }
    $.ajax({
        type: "get",
        url: "/actividad/cronograma/guardar/",
        data: {
            'cronograma': JSON.stringify(datos),
            'csrfmiddlewaretoken': '{{ csrf_token }}'
        },
        success: function (data) {
            if (data['result'] == "OK") {
                console.log("¡Registro de persona guardado exitosamente")
                //setTimeout("location.href='/actividad/listar'",10)
                swal("Cronograma Creada Correctamente!", "Da Clic en el boton para finalizar!", "success");
            } else {
                console.log("¡ Error en la transacción ")
                swal("Oops", "A ocurrido un error en el proceso!: \n Descripción: " + data['error'], "error")
            }
        }
    });
}
var numerosemana = ""
function generarTablaPlanificacion(data) {
    const tamanioarray = data['cronograma'].length
    console.log(`El Tamaño del arreglo es ${tamanioarray}`)
    if(!(data['cronograma'].length<=0)){
        console.log("Cumple proceso")
        console.log(data)
        $("#notadiv").show();
        $("#botondiv").show();
        $("#tabladiv").show();
        $('#mainTable tbody tr').remove(); // Limpiar cada una de las filas que contiene la tabla 
        $('#mainTable thead tr').remove();
        let contador = 0 // Creacion de contador para obtener el numero de filas
        let nuevaFila_TBody = ""; // Crear cadena de string que contendra el codigo HTML para ingresar los datos del ORM o actividad consultada 
        let nuevaFila_THead = "";
        let arregloFechas = []
        const dias = ['Lunes','Martes','Miercoles','Jueves','Viernes','Sabado','Domingo']
        let fechaInicio = new Date(data['fechas'][0]['fechainicio']);
        let fechaFin = new Date(data['fechas'][0]['fechafin']);
        numerosemana = data['fechas'][0]['numerosemana']
        if(numerosemana.length == 1){
            numerosemana = "0"+numerosemana
        }
    
        if(parseInt(data['existenota'])==1){
            $("#notasCronograma").text(data['notaarea'][0]['nota']);
            $("#botondiv").hide();
            $('#notasCronograma').prop('readonly', true);
            $("#notadiv").hide();
            $("#notatabladiv").show();
            console.log(data['notaarea'][0]['nota'] )
            let notaTexto = data['notaarea'][0]['nota']
            notaTexto = notaTexto.replace(/\n/g, "<br>");
            console.log(notaTexto)
            nuevaFilaNota = "<tr>";
            nuevaFilaNota += "<td class="+'bodycrono'+">" + notaTexto + "</td>";
            nuevaFilaNota += "</tr>";
            $("#tablanota tbody").append(nuevaFilaNota);
        }
        
        nuevaFila_THead = "<tr>";
        nuevaFila_THead += "<td class='headercrono'> # </td>";
        nuevaFila_THead += "<td class='headercrono'> Actividad </td>";
        nuevaFila_THead += "<td class='headercrono'> Cobertura </td>";
        nuevaFila_THead += "<td class='headercrono'> Responsable </td>";
        nuevaFila_THead += "<td class='headercrono'> Requerido </td>";
        
        while (fechaFin.getTime() >= fechaInicio.getTime()) {
            fechaInicio.setDate(fechaInicio.getDate() + 1);
            //console.log(fechaInicio.getFullYear() + '-' + (fechaInicio.getMonth() + 1) + '-' + fechaInicio.getDate());
            arregloFechas.push((fechaInicio.getFullYear() + '-' + (fechaInicio.getMonth() + 1) + '-' + fechaInicio.getDate()))
        }
    
        for (let index = 0; index < arregloFechas.length; index++) {
            const farray = moment(arregloFechas[index],"YYYY-MM-DD").format("DD-MMM");
            nuevaFila_THead += "<td class="+"'cronotabla'"+">" + dias[index]+"<br />"+farray+ "</td>";
            
        }
        nuevaFila_THead += "</tr>";
        $("#mainTable thead").append(nuevaFila_THead);
        $( ".cambiotd" ).css( "width", "50px " );
        for (let i in data['cronograma']) {
            nuevaFila_TBody = "<tr>";
            nuevaFila_TBody += "<td class='bodycrono id_css'>" + (parseInt(i) + 1) + "</td>";
            nuevaFila_TBody += "<td class='bodycrono actividad_css'>" + data['cronograma'][i]['nombre'] + "</td>";
            nuevaFila_TBody += "<td class='bodycrono cobertura_css'>" + data['cronograma'][i]['cobertura'] + "</td>";
            nuevaFila_TBody += "<td class='bodycrono responsable_css'>" + data['cronograma'][i]['responsable'] + "</td>";
            nuevaFila_TBody += "<td class='bodycrono requerido_css'>" + data['cronograma'][i]['requerido'] + "</td>";
    
            for (let index = 0; index < arregloFechas.length; index++) {
                const farray = arregloFechas[index]
                const fi = data['cronograma'][i]['fechainicio']
                const ff = data['cronograma'][i]['fechafin']
                //console.log(`fecha arreglo  ${farray} - fechainicio ${fi} - fechaFin ${ff}`)
    
                if ((compare(farray, fi) == 1 || compare(farray, fi) == 0) & (compare(farray, ff) == -1 || compare(farray, ff) == 0)) {
                    nuevaFila_TBody += "<td class="+'bodycrono_act'+" style=" + "'text-align:center;'" + "><span class="+"'glyphicon glyphicon-ok'"+"></span></td>";	
                }
                 else {
                    nuevaFila_TBody += "<td class="+'bodycrono'+" style=" + "'text-align:center;'" + "><span class="+"'glyphicon glyphicon-ban-circle'"+"></span></td>";
                }
            }
            nuevaFila_TBody += "</tr>";
    
            $("#mainTable tbody").append(nuevaFila_TBody);  // Añadir la cadana de string dentro del cuerpo de la tabla   
            $("#imprimir_boton").prop("disabled",false);
        }
    }else{
        console.log("no cumple proceso")
        swal("Oops", "No hay actividades generadas en esta semana. \n Por favor genere la lista de actividades para generar la planificación!", "info")
    }

}

function compare(dateTimeA, dateTimeB) {
    let momentA = moment(dateTimeA,"YYYY-MM-DD");
    let momentB = moment(dateTimeB,"YYYY-MM-DD");
    if (momentA > momentB) return 1;
    else if (momentA < momentB) return -1;
    else return 0;
}
