function impresionCronograma() {
    const doc = new jsPDF('l','mm', 'a4');
    var imgData = 'data:image/png;base64,'
    doc.addImage(imgData, 'JPG', 9, 15, 50, 17)
    doc.setFontType('bold')
    doc.setFontSize(16)
    doc.text("PLANIFICACION SEMANAL DE ACTIVIDADES DEL DEPARTAMENTO DE", 62, 24);
    doc.text("TECNOLOGÍA", 147, 30);
    doc.setFontSize(36);
    doc.text(numerosemana, 262, 30);
    doc.setFontSize(16)
    doc.text("SEM.", 263, 17);
    //doc.autoTable({html: '#mainTable'}); fontSize: number = 10
    //finalY = doc.previousAutoTable.finalY;
    doc.autoTable({
        startY: 35,
        html: '#mainTable',
        useCss: true,
    });
    finalY = doc.previousAutoTable.finalY + 5;
    doc.autoTable({
        startY: finalY,
        html: '#tablanota',
        useCss: true,
    });
    doc.save('table.pdf');
}
